import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes.js"

// key: 1,
// title: "Delegation",
// content:
//   "Q. How many



function App() {
  return (
    <div>
      <Header />
      {notes.map(noteInfo => (
        <Note
          title={noteInfo.title}
          content={noteInfo.content}
        />
      ))}
      <Footer />
    </div>
  );
}

export default App;
